import React from 'react';
import {Router, Route, Link} from 'react-router-dom';
import { InputGroup, InputGroupAddon, InputGroupText, Input } from 'reactstrap';

//회원 가입
function SignIn() {
    return (
        <div
            className="signIN_container d-flex justify-content-center align-self-center"
            style={{
                margin: "100px"
            }}>
            <Form className="w-75">
                <h3 style={{
                        marginBottom: '1%'
                    }}>회원 가입</h3>

                <InputGroup>
                    <InputGroupAddon addonType="prepend">
                        <InputGroupText>이름</InputGroupText>
                    </InputGroupAddon>
                    <Input placeholder="username"/>
                </InputGroup>

                <div className="form-group ">
                    <label
                        style={{
                            float: 'left'
                        }}>이름</label>
                    <input
                        type="text"
                        className="form-control w-50"
                        placeholder="First name"
                        id="name"/>
                </div>

                <div className="form-group">
                    <label
                        style={{
                            float: 'left'
                        }}>성별</label>
                    <input type="text" className="form-control" placeholder="First name" id="name"/>
                </div>

                <div className="form-group">
                    <label
                        style={{
                            float: 'left'
                        }}>생년월일</label>
                    <input type="text" className="form-control" placeholder="First name" id="name"/>
                </div>

                <div className="form-group">
                    <label
                        style={{
                            float: 'left'
                        }}>아이디</label>
                    <input type="text" className="form-control" placeholder="First name" id="name"/>
                </div>

                <div className="form-group">
                    <label
                        style={{
                            float: 'left'
                        }}>비밀번호</label>
                    <input
                        type="password"
                        className="form-control"
                        placeholder="First name"
                        id="name"/>
                </div>

                <div className="form-group">
                    <label
                        style={{
                            float: 'left'
                        }}>비밀번호 확인</label>
                    <input
                        type="password"
                        className="form-control"
                        placeholder="First name"
                        id="name"/>
                </div>

                <div className="form-group">
                    <label
                        style={{
                            float: 'left'
                        }}>소속 지역 본부</label>
                    <input type="text" className="form-control" placeholder="First name" id="name"/>
                </div>

                <div className="form-group">
                    <label
                        style={{
                            float: 'left'
                        }}>휴대폰 번호</label>
                    <input type="text" className="form-control" placeholder="First name" id="name"/>
                </div>

                <div className="form-group">
                    <label
                        style={{
                            float: 'left'
                        }}>이메일 주소</label>
                    <input type="text" className="form-control" placeholder="First name" id="name"/>
                </div>

                <div className="form-group">
                    <label
                        style={{
                            float: 'left'
                        }}>1356 아이디</label>
                    <input type="text" className="form-control" placeholder="First name" id="name"/>
                </div>

                <button
                    type="submit"
                    className="btn btn-primary btn-block w-25"
                    style={{
                        float: 'right'
                    }}>회원 가입</button>
            </Form>
        </div>
    )
}
export default SignIn;
